/*For testing*/
DROP TABLE IF EXISTS Users;
DROP TABLE IF EXISTS Transactions;
create table Users (
	user_id VARCHAR(24),
	username VARCHAR(50),
	password VARCHAR(50),
	email VARCHAR(50),
	mobile VARCHAR(50),
	ic_number VARCHAR(50),
	PRIMARY KEY (`user_id`)
)ENGINE=InnoDB;



CREATE TABLE Transactions (
	transaction_id VARCHAR(50),
	transaction_type VARCHAR(50),
	user_id VARCHAR(24),
	transaction_title VARCHAR(50),
	amount DECIMAL(6,2),
    PRIMARY KEY (transaction_id),
    CONSTRAINT FK_UserTransactions FOREIGN KEY (user_id)
    REFERENCES Users(user_id)
    ON  update cascade 
)engine=innoDB;



